import React from "react";

import classes from "./MainHeader.module.css";
import logo from "../../images/keysee.png";

const MainHeader = () => {
  return (
    <header className={classes.header}>
      <nav class="navigation wrapper">
        <img src={logo} alt="KeySee" className={classes.logo__img} />
        <div className={classes.user__controls}>
          <img src="./img/user.png" alt="User Avatar" class="user__avatar" />
          <button class="btn btn__icon">
            <ion-icon
              name="chevron-down-outline"
              class="options__icon"
            ></ion-icon>
          </button>
        </div>
      </nav>
    </header>
  );
};

export default MainHeader;
